import { Select } from "antd";
import { useNavigate } from "react-router-dom";



function AdminNavBar(){
    const {Option,OptGroup} = Select;
    const navigate = useNavigate();

  
    const handleChange = (value)=>{
        
        navigate(`${value}`);
    };

    return(
        <div>
            <Select defaultValue='Menegment' >
               <OptGroup label = 'Users'/>
                <Option value='userBlocking' onClick={handleChange}>Blocking</Option>
                <Option value='orderStatusChange' onClick={handleChange}>Change order status</Option>
                <OptGroup label = 'Users-statistics'/>
                <Option value='usersData' onClick={handleChange}>Get users data</Option>
                <OptGroup label = 'manegment-statistics'/>
                <Option value = 'standart-pizza-list' onClick={handleChange}></Option>
            </Select>
            <Select defaultValue='getStatistics' >
           
                
                
            </Select>
            <Select defaultValue='Directory management'>
            
                <Option value = 'standart-pizza-list' onClick={handleChange}></Option>
            </Select>
        </div>
    )
}
export default AdminNavBar;
